class Solution(object):
    def makeTheIntegerZero(self, num1, num2):
        """
        :type num1: int
        :type num2: int
        :rtype: int
        """
        operations = 0
        if num2 >= 0:
            return -1
        while num1 > 0 and operations <= 60:
            i = 60
            while i >= 0:
                if num1 - (2 ** i + num2) >= 0:
                    num1 -= (2 ** i + num2)
                    operations += 1
                    break
                i -= 1
            if i < 0:
                return -1
        if num1 == 0:
            return operations
        else:
            return -1
